import * as React from 'react';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select, { SelectChangeEvent } from '@mui/material/Select';


interface Props {
  value: string;
  onInputChange: (value: string) => void;
}

const Selects: React.FC<Props> = ({ value, onInputChange }) =>  {
  const [selectGovernment, setSelectGovernment] = React.useState('');

  const handleChange = (event: SelectChangeEvent) => {
    setSelectGovernment(event.target.value as string);
  };
  return (

    <FormControl sx={{ m: 1, minWidth: 140 }} size="small">
      <InputLabel sx={{zIndex:0}} id="demo-select-small-label">Government</InputLabel>
      <Select
              labelId="demo-simple-select-label"
              id="demo-simple-select"
              value={selectGovernment}
              label="Government"
              onChange={handleChange}
            >
              <MenuItem value={'DESPOTISM'}>DESPOTISM</MenuItem>
              <MenuItem value={'PATRIARCHY'}>PATRIARCHY</MenuItem>
              <MenuItem value={'ETHNOCRACY'}>ETHNOCRACY</MenuItem>
            </Select>
    </FormControl>
  );
}
